import React from 'react';
import { Nav, NavItem, Dropdown, DropdownItem, DropdownToggle, DropdownMenu, NavLink } from 'reactstrap';

export default class NavBar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      dropdownOpen: false
    };
  }

  toggle() {
    this.setState({
      dropdownOpen: !this.state.dropdownOpen
    });
  }

  render() {
    return (
      <div>
        <Nav pills>
          <NavItem>
            <NavLink href="#" active>Home</NavLink>
          </NavItem>          
          <NavItem>
            <NavLink href="#">About Us</NavLink>
          </NavItem>
          <Dropdown nav isOpen={this.state.dropdownOpen} toggle={this.toggle}>
            <DropdownToggle nav caret>
              Cake
            </DropdownToggle>
            <DropdownMenu>
              <DropdownItem header>Anniversary Cake</DropdownItem>
              <DropdownItem disabled>Fondant Cake</DropdownItem>
              <DropdownItem>Barbie Doll Cake</DropdownItem>
              <DropdownItem divider />
              <DropdownItem>Birthday Cake</DropdownItem>
            </DropdownMenu>
          </Dropdown>
          <NavItem>
            <NavLink href="#">Combo Offers</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Flowers</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Gifts</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Contact Us</NavLink>
          </NavItem>
        </Nav>
      </div>
    );
  }
}
